I attached the generated code that throws the exception in the line 191353 when invoking
`(0,types.hy)(buttonName, 'buttonName');`
It seems as if the variable `types` would be undefined.

The file tst_examples_vendors.js is actually not a main entry point but rather a common vendors file automatically generated by webpack here:
```js
      splitChunks: {
        cacheGroups: {
          commons: {
            test: /\.(js|jsx|ts|tsx)$/i,
            name: 'tst_examples_vendors',
            chunks: 'all',
            minChunks: 2
          }
        }
      },
```
[tst_examples_vendors.js.zip](https://github.com/webpack/webpack/files/6264984/tst_examples_vendors.js.zip)

Here is what I am seeing:

``` js
// EXTERNAL MODULE: ./src/framework/ods/types.ts
if (751 == __webpack_require__.j) {
var types = __webpack_require__(93738);
}
```

* You have multiple runtimes.
* `types` is only needed in runtime `751` (at least webpack thinks that)
* `types` is used by `UiSelectButton` and `UiButton` so these exports/classes should be only used in runtime `751`
* `UiButton` is used by `UiElementSelectCustom` which is also flagged as only needed in runtime `751`

---

With pathinfo I can now tell more:

``` js
  /*! export UiButton [provided] [used in tst_examples_uiform] [renamed to wg] */
  /*! export UiSelectButton [provided] [used in tst_examples_uitable] [renamed to rd] -> ./src/framework/ods/UiButton/select.ts .UiSelectButton */
```

I can't tell exactly what runtime `751` is, but it either `tst_examples_uiform` or `tst_examples_uitable`, but `types` should be used in both as UiButton is used in tst_examples_uiform and UiSelectButton is used in tst_examples_uitable.

``` js
  /*! export UiElementSelectCustom [provided] [used in tst_examples_uiform] [renamed to Kr] -> ./src/framework/uielement/private/UiElementSelectCustom.ts .UiElementSelectCustom */
```

So runtime `751` === tst_examples_uiform. Which makes `types` missing in `tst_examples_uitable`. So I guess the error happens when `new UiSelectButton()` is called on the `tst_examples_uitable` page?
